import React, { Component } from "react";
import Banner from "../../components/Banner/Banner";
import './StyleVideoHot.css'
class VideoHot extends Component {
  render() {
    return (
      <div>
        <Banner />
        <div className="container">
          <div className="row">
            <div className="col-md-8 col-sm-8 col-lg-8">
              <iframe className="iframe-video-hot"
                scrolling="no"
                src="https://zingmp3.vn/embed/video/ZWAEZFWB?start=false"
                frameBorder={0}
                allowFullScreen="true"
              />

<h3>No.2 #zingchart</h3>
<h3>Đếm Cừu</h3>
<h4>Han Sara, Kay Trần</h4>
<h4>Thể loại: Việt Nam,Nhạc Trẻ,V-Pop</h4>


            </div>
            <div className="col-md-4 col-sm-4 col-lg-4" />
          </div>
        </div>
      </div>
    );
  }
}

export default VideoHot;
